import React, {Component} from 'react';


export class HomeButton extends React.Component{
    constructor(){
        super();
        this._onClick = this._onClick.bind(this);
    }

    render(){
        return (<div>
            <a onClick = {() => this.props.updatePage('home')} id="home_button" href="/index.html">HOME</a> | <a id="about_button" href="/about.html">ABOUT</a>
        </div>);
    }
}

export default AboutButton;
